// Función para generar una fecha aleatoria dentro de un rango específico
function generateRandomDate(start, end) {
    const startTime = start.getTime();
    const endTime = end.getTime();
    const randomTime = startTime + Math.random() * (endTime - startTime);
    return new Date(randomTime);
  }

  // Función para generar una fecha y hora aleatoria dentro de un rango específico
  function generateRandomDateTime(start, end) {
    const randomDate = generateRandomDate(start, end);
    const randomTime = Math.floor(Math.random() * 24) + ':' + Math.floor(Math.random() * 60);
    return `${randomDate.toLocaleDateString()} ${randomTime}`;
  }
